function Input(props) {
  return (
    <div>
        <label className="block text-gray-700 text-sm font-bold mb-2">{props.label}
        <input type={props.type} value={props.value} placeholder={props.placeholder} className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"/>
        </label>


    </div>
  )
}

export default Input
